function replaceAll(source, from, to, caseSensitive = true) {
    return source.replace(new RegExp(from.replace(/([\/\,\!\\\^\$\{\}\[\]\(\)\.\*\+\?\|\<\>\-\&])/g, '\\$&'), (!caseSensitive ? 'gi' : 'g')), (typeof (to) === 'string') ? to.replace(/\$/g, '$$$$') : to);
}
function str2rgb(str) {
    const rgb = [];
    const result = str.match(/^rgba?\((\d+),\s*(\d+),\s*(\d+)(?:,\s*(\d+(?:\.\d+)?))?\)$/);
    rgb[0] = result[1];
    rgb[1] = result[2];
    rgb[2] = result[3];
    if (rgb[3]) {
        rgb[3] = result[4];
    }
    return rgb;
}
function rgb2str(r, g, b, a) {
    if (a) {
        return `rgba(${r},${g},${b},${a})`;
    }
    else {
        return `rgb(${r},${g},${b})`;
    }
}
function grayscale(r, g, b, amount = 1) {
    var intensity = 0.3 * r + 0.59 * g + 0.11 * b;
    return rgb2str(Math.floor(intensity * amount + r * (1 - amount)), Math.floor(intensity * amount + g * (1 - amount)), Math.floor(intensity * amount + b * (1 - amount)));
}

const pixelIconCss = "pixel-icon{display:inline-block;font-family:\"PixelIcons\";font-size:30px}";

const PixelIcon = class {
    constructor(hostRef) {
        index.registerInstance(this, hostRef);
    }
    // Methods
    computeIcon() {
        if (!this.icon) {
            this.icon = this.root.innerHTML;
        }
        if (this.svg) {
            if (icons[this.icon]) {
                let svgContent = icons[this.icon].data.svg;
                // Replace width
                const attrs = 'width=\"150\" height=\"150\"';
                svgContent = svgContent.replace(attrs, `width=\"1em\" height=\"1em\" viewBox=\"0 0 150 150\"`);
                // Replace colors
                for (let i = 0; i < icons[this.icon].data.colors.length; i++) {
                    const newColor = this.root.getAttribute(`color-${i + 1}`);
                    if (newColor) {
                        svgContent = replaceAll(svgContent, icons[this.icon].data.colors[i], newColor);
                    }
                    else if (this.grayscale) {
                        const [r, g, b] = str2rgb(icons[this.icon].data.colors[i]);
                        const grayColor = grayscale(r, g, b);
                        svgContent = replaceAll(svgContent, icons[this.icon].data.colors[i], grayColor);
                    }
                }
                this.svgContent = svgContent;
            }
        }
        else {
            this.svgContent = '';
        }
    }
    // Lifecycle
    componentWillLoad() {
        this.computeIcon();
    }
    render() {
        return (index.h(index.Host, { innerHTML: this.svgContent }, !this.svg && index.h("span", { class: `pi pi-${this.icon}` })));
    }
    get root() { return index.getElement(this); }
};
PixelIcon.style = pixelIconCss;

exports.pixel_icon = PixelIcon;
